import axios from 'axios';

const COMPUTER_BASE_REST_API_URL = 'http://localhost:8090/api/v1/computers';

class ComputerServices {
    getAllComputerss() {
        return axios.get(COMPUTER_BASE_REST_API_URL);
    }

    createComputers(computer) {
        return axios.post(COMPUTER_BASE_REST_API_URL, computer);
    }
}

// eslint-disable-next-line import/no-anonymous-default-export
export default new ComputerServices();
